import { useState, useEffect } from "react";

function Weathercall({ data }) {
    return (
        <div className='pt-8 pl-12'>
            <div className='pl-4'>
                <p className='text-4xl'>{data.name ? String(data.name)+', ' +String(data.sys.country) :null}</p>
                <p className='text-2xl'>{data.dt ? (new Date(data.dt*1000).toDateString()):null}</p>
            </div>


            <div>
                {data.main ? (<p>{data.weather[0].description}</p>):(<p>loading</p>)}
                {data.main ? (<p>{data.main.temp}</p>):(<p>loading</p>)}
                {data.main ? (<p>High: {data.main.temp_max}</p>):(<p>loading</p>)}
                {data.main ? (<p>Low: {data.main.temp_min}</p>):(<p>loading</p>)}
                <p className='text-2xl'>Sunrise: {data.dt ? (new Date(data.sys.sunrise*1000).toDateString()):null}</p>
            </div>



        </div>
    )
}
export default Weathercall;
